void comp(unsigned char* COMP, const unsigned char* FREQ) {
    rint cnt = 0;
    for(rint i = 0; i < 999999; i+=3) {
        rint bit = ((int)FREQ[i]-'J')*1369 + ((int)FREQ[i+1]-'J')*37 + FREQ[i+2]-'J'; 
        COMP[cnt++] = bit >> 8;
        COMP[cnt++] = bit & 0xff;
    }
    COMP[cnt] = FREQ[999999];
}

void decomp(unsigned char* FREQ, const unsigned char* COMP) {
    rint cnt = 0;
    rint cur = 0;
    while(cnt < 999998) {
        rint bit = ((int)COMP[cur]<<8) + COMP[cur+1];
        FREQ[cnt++] = bit /1369 + 'J';
        FREQ[cnt++] = bit %1369/37 + 'J';
        FREQ[cnt++] = bit %37 + 'J';
        cur+=2;
    }
    FREQ[cnt] = COMP[cur];
}